Usually it's just one foreigner staff making the drinks. Not sure why everyone seem to complain about him because it must be hard trying to run it alone at a location like One Utama. He makes the drinks good and efficient too!", 'time': 1698242635, 'translated': False}, {'author_name': 'Ting Ting', 'author_url': 'https://www.google.com/maps/contrib/114390130826335663448/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocIbl4PxfkzgeN7f49-MIP8FxMoxaktXybp6stexHLP5qg=s128-c0x00000000-cc-rp-mo-ba6', 'rating': 2, 'relative_time_description': '5 months ago', 'text': 'Busy Gong Cha outlet located at a busy location at the old wing of 1 Utama. The young lady at the payment counter was not friendly at all and has an attitude facial expression throughout the ordering.

The quality and taste of the winter melon tea is not the same as the other store. Please do look into this management team ensuring your staff is not ruining the original taste of the tea.', 'time': 1684740957, 'translated': False}, {'author_name': 'Gavin Pang', 'author_url': 'https://www.google.com/maps/contrib/112039929827500828822/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjUuZQUbtTWUfmluWTxjZ23AbWkH-_FT6BEXHLKO0xXfzRwD=s128-c0x00000000-cc-rp-mo-ba6', 'rating': 4, 'relative_time_description': '10 months ago', 'text': 'Had the Brown Sugar Earl Grey Milk Tea with Coffee Jelly at 30% sweetness. RM12. The coffee jelly tastes good and nice to chew. But the drink was still a bit too sweet. I recommend this but suggest not to stir completely to mix all the sugar at the bottom to lessen the sweetness. Suggest Gong Cha to reduce the sweetness also as not to overwhelm but preserve the taste of tea so people can enjoy the tea.', 'time': 1672499612, 'translated': False}, {'author_name': 'Doris C', 'author_url': 'https://www.google.com/maps/contrib/102932135945258651945/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocIFg2QXn1-h8VptS5GN2HO-BNFodSMPQARJA_rZoW0T=s128-c0x00000000-cc-rp-mo', 'rating': 5, 'relative_time_description': '3 months ago', 'text': "Would like to praise Shafiq who is serving at this outlet. He's very efficient even though he works solo and provides excellent customer service. Not to mention he is also a very diligent staff. He is indeed a good asset to the company that hired him.", 'time': 1690563969, 'translated': False}, {'author_name': 'mohd shah', 'author_url': 'https://www.google.com/maps/contrib/112933561734858562534/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocJaSIzS4islksP_2tNSVnxQ1iFC-Z4Ft-OmIe8C_aR9=s128-c0x00000000-cc-rp-mo', 'r