Usually it's just one foreigner staff making the drinks. Not sure why everyone seem to complain about him because it must be hard trying to run it alone at a location like One Utama. He makes the drinks good and efficient too!", 'time': 1698242635, 'translated': False}, {'author_name': 'Ting Ting', 'author_url': 'https://www.google.com/maps/contrib/114390130826335663448/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocIbl4PxfkzgeN7f49-MIP8FxMoxaktXybp6stexHLP5qg=s128-c0x00000000-cc-rp-mo-ba6', 'rating': 2, 'relative_time_description': '5 months ago', 'text': 'Busy Gong Cha outlet located at a busy location at the old wing of 1 Utama. The young lady at the payment counter was not friendly at all and has an attitude facial expression throughout the ordering.

