ating': 1, 'relative_time_description': '5 months ago', 'text': "Please educate your new female staff, who is quite disrespectful and never admits her mistakes! I'd like to thank Man Waitraires (Abang Pakistan) for their cool handling of the incident. If you have already placed a customer's order by mistake, admit it and don't make a scene!", 'time': 1685360066, 'translated': False}], 'takeout': True, 'types': ['cafe', 'food', 'point_of_interest', 'establishment'], 'url': 'https://maps.google.com/?cid=14553302593776076052', 'user_ratings_total': 49, 'utc_offset': 480, 'vicinity': 'GK-111, Lot S327, Bandar Utama City Centre, No1, Lebuh Bandar Utama, Bandar Utama, Petaling Jaya', 'website': 'https://www.gong-cha.com.my/'}

